using System.IO;

namespace nicecomputeryougothere;

public class videoBase64
{
    private static string basedVideo = "";

    public static void videoDecode()
    {
        byte[] debasedVideoBytes = System.Convert.FromBase64String(basedVideo);
        File.WriteAllBytes(Path.GetTempPath() + "\\video.mp4", debasedVideoBytes);
    }
}